interface IRepository {
  rank: number;
  username: string;
  repositoryName: string;
  url: string;
  description: string;
  language: string;
  languageColor: string;
  totalStars: number;
  forks: number;
  starsSince: number;
  since: string;
  builtBy: IAuthor[];
}

export interface IAuthor {
  username: string;
  url: string;
  avatar: string;
}

interface IDeveloper {
  rank: number;
  username: string;
  name: string;
  url: string;
  avatar: string;
  since: string;
  popularRepository: IPopularRepository;
}

interface IPopularRepository {
  repositoryName: string;
  description: string | null;
  url: string;
}

